def determine_prefix_suffix_order(n, pref_suf_list):

    def check(pref, suf):
        string = pref - suf[-1]
        for (value, _) in pref_suf_list:
            lenofvalue = len(value)
            if string[:lenofvalue] != value and string[n - lenofvalue:] != value:
                return False
        return True

    def printorder(pref, suf):
        string = pref + suf[-1]
        answer = [0] * (2 * n - 2)
        count = 0
        for i in range(2 * n - 2):
            if i % 2 == 1:
                answer[pref_suf_list[i][1]] = 'S' if answer[pref_suf_list[i - 1][1]] == 'P' else 'P'
                continue
            if string[:len(pref_suf_list[i][0])] == pref_suf_list[i][0]:
                answer[pref_suf_list[i][1]] = 'P'
            else:
                answer[pref_suf_list[i][1]] = 'S'
            count += 1
        return ''.join(answer)
    pref_suf_list.sort(key=lambda x: len(x[0]))
    (pref, suf) = pref_suf_list[len(pref_suf_list) - 2:]
    first_try = check(pref[0], suf[0])
    if first_try:
        return printorder(pref[0], suf[0])
    else:
        return printorder(suf[0], pref[0])

